import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import HeroSection from '../../components/landingpage/HeroSection.js';
import AboutUs from './../../components/landingpage/AboutUs';
import Services from './../../components/landingpage/Services';
import Portfolio from './../../components/landingpage/Portfolio';
import Testimonials from './../../components/landingpage/Testimonials';
import ContactUs from './../../components/landingpage/ContactUs';
import FAQ from './../../components/landingpage/FAQ';
// import "./../../css/landingPage.css";

const LandingPage = () => {
  return (
    <Router>
      <div>
        {/* Header Section with Navigation Tabs */}
        <header style={{ padding: '20px', backgroundColor: '#f8f8f8', textAlign: 'center' }}>
          <nav>
            <Link to="/about" style={{ margin: '0 15px' }}>About Us</Link>
            <Link to="/services" style={{ margin: '0 15px' }}>Services</Link>
            <Link to="/portfolio" style={{ margin: '0 15px' }}>Portfolio</Link>
          </nav>
        </header>

        <HeroSection />

        <Switch>
          <Route path="/about" component={AboutUs} />
          <Route path="/services" component={Services} />
          <Route path="/portfolio" component={Portfolio} />
          <Route path="/" exact>
            <Testimonials />
            <ContactUs />
            <FAQ />
          </Route>
        </Switch>
      </div>
    </Router>
  );
};

export default LandingPage;
